import React from "react";

export const TopBar = () => {
  return (
    <div className="topbar">
      <div className="logo">
        <img src="" alt="" />
      </div>
      <div className="buttons">
        <a href="#" className="button">Home</a>
        <a href="#" className="button">Products</a>
        <a href="#" className="button">Contacts</a>
        <a href="#" className="button">About Us</a>
      </div>
    </div>
  );
};
